import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

export default class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: 'React'
        },  
        {
          name: 'Angular'
        },
        {
          name: 'Vue'
        },
      ]
    }
  }
  render() {
    return (
      <div className="App">
       {
         this.state.monsters.map(monsters => <h1>{monsters.name}</h1>)
       }
      </div>
    );
  }
}
